        body {

            display: none;

            color: #721c24;
            padding: 15px;
            border-radius: 5px;
            width: 300px;
            margin: 10px auto; /* 중앙 정렬을 위해 margin 추가 */
        }

        button {
            background-color: red;
            color: #fff;
            padding: 30px 60px;
            font-size: 30px;
            border: none;
            border-radius: 10px;
            cursor: pointer;
        }

        button:hover {
            background-color: red;
        }

        #warning{
            display: flex;
            align-items: center;
            bottom: 10px;
            font-size: 30px;
         }

    function showReportDialog() {
            // 버튼 클릭 시 알림 표시
            var alertDiv = document.getElementById('alertMessage');
            alertDiv.style.display = 'block';

            // 일정 시간(예: 3초) 후에 알림을 다시 숨김
            setTimeout(function() {
                alertDiv.style.display = 'none';
            }, 3000);

                crs: L.CRS.EPSG3857,
                zoom: 17,
                zoomControl: true,
                preferCanvas: false,
            }
        );

        var marker;
        var pinkMarker;

        function moveToCurrentLocation() {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(showPosition);
            } else {
                alert("Geolocation이 지원되지 않습니다.");
            }
        }

        function showPosition(position) {
            var latitude = position.coords.latitude;
            var longitude = position.coords.longitude;

            // 마커가 없으면 생성, 있으면 위치 업데이트
            if (!marker) {
                // 빨간색의 원 모양 마커
                var redIcon = new L.Icon({
                    iconUrl: 'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-red.png',
                    iconSize: [25, 41],
                    iconAnchor: [12, 41],
                    popupAnchor: [1, -34],
                    shadowSize: [41, 41],
                });

                marker = L.marker([latitude, longitude], { icon: redIcon }).addTo(map_5aabdd27352a301ac9c9bb5d92843c94)
                    .bindPopup('현재 위치')
                    .openPopup();
            } else {
                marker.setLatLng([latitude, longitude]);
                marker.getPopup().setContent('현재 위치');
            }
            var pinkIcon = L.divIcon({
                className: 'custom-div-icon',
                html: "<div style='background-color: pink; width: 25px; height: 25px; border-radius: 50%;'></div>",
                iconSize: [25, 25],
                iconAnchor: [12, 12],
            });

            // 고정된 위치 (예: 위도 33.535, 경도 126.553)
            var fixedLatitude = 33.5168108;
            var fixedLongitude = 126.5565399;

            if (!pinkMarker) {
                pinkMarker = L.marker([fixedLatitude, fixedLongitude], { icon: pinkIcon }).addTo(map_5aabdd27352a301ac9c9bb5d92843c94)
                    .bindPopup('사건발생위치 ')
                    .openPopup();
            } else {
                pinkMarker.setLatLng([fixedLatitude, fixedLongitude]);
                pinkMarker.getPopup().setContent('사건발생위치 ');
            }

            // 현재 위치로 중심 이동
            map_5aabdd27352a301ac9c9bb5d92843c94.setView([latitude, longitude], 17);
        }
